import Input from '../../Reusable/Input';
import Button from '../../Reusable/Button';
import '../Identification/Identification.scss';
import champList from '../../Listes/ChampList';

function Identification(props) {
    return (
      <>
        <div className="Identification">
          <h1 className='h1Test' >Créer un compte</h1>
          <form>
            {champList.map(champ => {
                return <li key={champList.id}>
                <Input label={label} />
                </li>
              })
            }
            <Input label={props.Nom} />
            <Input label={props.Email} />
            <Input label={props.Mdp} />
            <Input label={props.Conf} />
          </form>
          <Button text={'Se connecter'} />
        </div>
        <p className='Information'>Vous avez déjà un compte ? <a href='#'>Identifiez-vous !</a></p>
      </>
    );
}

export default Identification;
